#include "C4LogitechPlugin.h"


using namespace C4;


LogitechPlugin *C4::TheLogitechPlugin = nullptr;


C4::Plugin *CreatePlugin(void)
{
	return (new LogitechPlugin);
}


LogitechDevice::LogitechDevice(int connection, int index)
{
	LG::lgLcdOpenContext	context;

	context.connection = connection;
	context.index = index;
	context.onSoftbuttonsChanged.softbuttonsChangedCallback = nullptr;
	context.onSoftbuttonsChanged.softbuttonsChangedContext = nullptr;

	lgLcdOpen(&context);
	deviceHandle = context.device;

	deviceImage.Format = LGLCD_BMP_FORMAT_160x43x1;
	MemoryMgr::ClearMemory(deviceImage.pixels, 160 * 43);
}

LogitechDevice::~LogitechDevice()
{
	lgLcdClose(deviceHandle);
}

void LogitechDevice::UpdateDeviceImage(void)
{
	lgLcdUpdateBitmap(deviceHandle, &deviceImage, LGLCD_PRIORITY_NORMAL);
}


LogitechPlugin::LogitechPlugin() : Singleton<LogitechPlugin>(TheLogitechPlugin)
{
	logitechActive = false;

	if (Initialize() == kLogitechOkay)
	{
		LogitechDevice *device = deviceList.First();
		if (device)
		{
			MemoryMgr::CopyMemory(logoData, device->GetDeviceImage(), 160 * 43);
			device->UpdateDeviceImage();
		}
	}
}

LogitechPlugin::~LogitechPlugin()
{
	Terminate();
}

LogitechResult LogitechPlugin::Initialize(void)
{
	if (!logitechActive)
	{
		LG::lgLcdConnectContext		context;
		LG::lgLcdDeviceDesc			desc;

		if (lgLcdInit() != ERROR_SUCCESS)
		{
			return (kLogitechInitFailed);
		}

		context.appFriendlyName = TheEngine->GetApplicationName();
		context.isPersistent = false;
		context.isAutostartable = false;
		context.onConfigure.configCallback = nullptr;
		context.onConfigure.configContext = nullptr;

		if (lgLcdConnectA(&context) != ERROR_SUCCESS)
		{
			lgLcdDeInit();
			return (kLogitechInitFailed);
		}

		logitechConnection = context.connection;

		lgLcdSetDeviceFamiliesToUse(logitechConnection, LGLCD_DEVICE_FAMILY_KEYBOARD_G15, 0);
		for (machine index = 0;; index++)
		{
			if (lgLcdEnumerate(logitechConnection, index, &desc) != ERROR_SUCCESS)
			{
				break;
			}

			deviceList.Append(new LogitechDevice(logitechConnection, index));
		}

		logitechActive = true;
	} 

	return (kLogitechOkay);
} 

void LogitechPlugin::Terminate(void) 
{
	if (logitechActive)
	{ 
		logitechActive = false;
		deviceList.Purge(); 
 
		lgLcdDisconnect(logitechConnection);
		lgLcdDeInit();
	}
} 


